  "text" : "で、（現実の本当の意味での）宗教って、基本的に「あぁこの人はそっち派なんですね」で終わることが多いので、ということは、プログラミング言語やエディタは、自分と違う人を積極的に排除しようとするという意味で、宗教よりさらに危険な何かに該当しますね。",
